import React, { useState, useEffect } from "react";
import { fetchTransactionDetails } from "../services/transaction";
import { Transaction } from "../types/transaction";

interface Props {
  txHash: string;
}

const TransactionDetails: React.FC<Props> = ({ txHash }) => {
  const [transaction, setTransaction] = useState<Transaction | null>(null);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    const loadTransaction = async () => {
      try {
        const tx = await fetchTransactionDetails(txHash);
        setTransaction(tx);
        setError(null);
      } catch (err) {
        setError("Failed to fetch transaction details");
        console.error(err);
      }
    };
    loadTransaction();
  }, [txHash]);

  if (error) return <div className="result error">{error}</div>;
  if (!transaction) return <div className="result">Loading...</div>;

  return (
    <div className="result">
      <p><strong>TX Hash:</strong> {transaction.hash}</p>
      <p>
        <strong>Status:</strong>{" "}
        {transaction.status === 1 ? (
          <span style={{ color: "green" }}>âœ“ Success</span>
        ) : transaction.status === 0 ? (
          <span style={{ color: "red" }}>Failed</span>
        ) : (
          "Pending"
        )}
      </p>
      <p><strong>Block #:</strong> {transaction.blockNumber || "Pending"}</p>
      <p>
        <strong>Time:</strong>{" "}
        {transaction.timestamp
          ? new Date(transaction.timestamp * 1000).toLocaleString()
          : "N/A"}
      </p>
      <p><strong>TX Type:</strong> {transaction.txType}</p>
      <p><strong>From:</strong> {transaction.from}</p>
      <p><strong>To:</strong> {transaction.to || "N/A"}</p>
      <p><strong>Amount:</strong> {transaction.amount} KAIA</p>
      <p><strong>TX Fee:</strong> {transaction.txFee} KAIA</p>
      <p><strong>Gas Price:</strong> {transaction.gasPrice} KAIA</p>
      <p><strong>Effective Gas Price:</strong> {transaction.effectiveGasPrice} KAIA</p>
      <p>
        <strong>Gas Limit & Usage by TX:</strong> {transaction.gasLimit} /{" "}
        {transaction.gasUsed} ({((parseInt(transaction.gasUsed) / parseInt(transaction.gasLimit)) * 100).toFixed(2)}%)
      </p>
      <p><strong>Burnt Fee:</strong> {transaction.burntFee} KAIA</p>
      <p><strong>Fee Payer:</strong> {transaction.feePayer}</p>
      <p><strong>Fee Ratio:</strong> {transaction.feeRatio}</p>
      <p><strong>L_Fee Payer:</strong> {transaction.feePayerFee} KAIA</p>
      <p><strong>L_From:</strong> {transaction.fromFee} KAIA</p>
      <p><strong>Nonce:</strong> {transaction.nonce}</p>
      <p><strong>Method ID:</strong> {transaction.methodId}</p>
      <p><strong>Method Sig:</strong> {transaction.methodSig}</p>
    </div>
  );
};

export default TransactionDetails;
